    "cctv_by_year <- tribble(\n",
    "    ~year,  ~CCTV_Count,\n",
    "    2010, 0,\n",
    "    2011, 12,\n",
    "    2016, 12,\n",
    "    2018, 43,\n",
    "    2022, 120,\n",
    "    2025, 168\n",
    ")\n",
    "ggplot(data = cctv_by_year, aes(x = year, y = CCTV_Count)) +\n",
    "    geom_line() +\n",
    "    geom_point()"
   ]
  },
