   "source": [
    "nz_coastline <- st_read(\"/kaggle/input/nz-coastline-and-wellington-2013-meshblocks/lds-nz-coastlines-and-islands-polygons-topo-150k-SHP/nz-coastlines-and-islands-polygons-topo-150k.shp\")\n",
    "\n",
    "# clip to wellington region\n",
    "wgtn_bbox <- st_as_sfc(mb2013_wgtn |> st_bbox())\n",
    "# ggplot(data = wgtn_bbox) +\n",
    "#   geom_sf() +\n",
    "#   theme_minimal()\n",
    "\n",
    "tic()\n",
    "nz_coastline_wgtn <- st_intersection(wgtn_bbox, nz_coastline)\n",
    "toc()\n",
    "\n",
    "ggplot(data = nz_coastline_wgtn) +\n",
    "  geom_sf()\n"
   ]
