   "source": [
    "# Let's do some scene setting\n",
    "What does victimisation look like in the Wellington region over the time frame of the data? We should check what this looks like at year by year scale, and down to half year (or even quarterly or monthly).\n",
    "\n",
    "First we need to get our time dimension set up and aggregate the victimisations."
   ]
  },
  {
   "cell_type": "markdown",
   "id": "2d708d00",
   "metadata": {
    "papermill": {
     "duration": 0.02631,
     "end_time": "2025-08-07T02:29:51.347372",
     "exception": false,
     "start_time": "2025-08-07T02:29:51.321062",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "Aggregate to meshblock and year. But, also let's aggregate to meshblock and half year. We want to maximise the time difference available to us in the victimisation data and there is potential here to go from 2022H2 to 2025H1."
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 15,
   "id": "0bbd0028",
   "metadata": {
    "execution": {
     "iopub.execute_input": "2025-08-07T02:29:51.402177Z",
