     "start_time": "2025-08-07T02:29:51.373628",
     "status": "completed"
    },
    "tags": []
   },
   "outputs": [],
   "source": [
    "vtp$month <- str_extract(vtp$`Month Year`,\"[^ ]+\")\n",
    "vtp <- vtp |> \n",
    "    # mutate(half_year = ifelse(month %in% c(\"January\", \"February\", \"March\", \"April\", \"May\", \"June\"), \"h1\", ifelse(month %in% c(\"July\", \"August\", \"September\", \"October\", \"November\", \"December\"), \"h2\", \"NA\") )) |>\n",
    "    mutate(year_month_dt = as.Date(paste(\"1\", month, year), format = \"%d %B %Y\")) |>\n",
    "    mutate(year_quarter = quarter(year_month_dt, with_year = TRUE)) |>\n",
    "    mutate(year_half = semester(year_month_dt, with_year = TRUE))\n",
    "    # mutate(half_year = paste0(year(year_month_dt), \"H\", halfyear(year_month_dt)))\n",
    "\n",
    "\n",
    "# glimpse(vtp)"
   ]
