   "source": [
    "vtp_year_month_mb_anzsocd_2022h1_2025h1 <-\n",
    "    vtp |>\n",
    "    filter(year_half %in% c(\"2022.1\", \"2025.1\")) |>\n",
    "    group_by(year_half, meshblock = Meshblock, anzsoc_division = `ANZSOC Division`) |>\n",
    "    summarise( vs = sum(Victimisations), .groups = \"drop\") |>\n",
    "    mutate(year_half = as.character(year_half)) |> # for some reason pivot_wider won't work on a column in a tibble of type <glue> - which I don't get as <glue> is a just a character specialised class\n",
    "    pivot_wider(\n",
    "        names_from = year_half,\n",
    "        values_from = vs\n",
    "    ) |>\n",
    "    replace_na(list(`2022.1` = 0, `2025.1` = 0)) |>\n",
    "    left_join(wgtn_mbs_less_viewsheds, join_by(meshblock == MeshblockN)) |>\n",
    "    select(meshblock, anzsoc_division, ChangeInAreaRatio, `2022.1`, `2025.1`)\n",
    "\n",
    "vtp_year_month_mb_anzsocd_2022h1_2025h1$v_2022h1_2025h1 <- vtp_year_month_mb_anzsocd_2022h1_2025h1$`2025.1` - vtp_year_month_mb_anzsocd_2022h1_2025h1$`2022.1`\n",
    "\n",
    "# glimpse(vtp_year_month_mb_anzsocd_2022h1_2025h1)\n",
    "\n",
    "# the ANZSOC Division colours again don't show a significant distribution one way or the other\n",
    "ggplot(data = vtp_year_month_mb_anzsocd_2022h1_2025h1) +\n",
    "  geom_point(mapping = aes(x = ChangeInAreaRatio, y = v_2022h1_2025h1, colour = anzsoc_division)) +\n",
    "  labs(x = \"Proportion of Meshblock in Viewshed\", y = \"Victimisations 2025H1 minus victimisations 2022H1\")\n"
   ]
  },
