    "# Let's see if we can find a way to chart this\n",
    "\n",
    "ggplot(data = anzsocd_cameraimpact_changeratio, aes(x = anzsoc_division, y = change_ratio, fill = CameraImpact)) +\n",
    "    geom_col() +\n",
    "    scale_fill_manual(values = c(\"TRUE\" = \"steelblue\", \"FALSE\" = \"tomato\")) +\n",
    "    geom_hline(yintercept = 0, color = \"black\") +\n",
    "    theme(axis.text.x = element_text(angle = 45, hjust = 1))"
   ]
  },
