   "source": [
    "# What does this all mean????\n",
    "Naively it doesn't look like the CCTV network is reducing victimisation excepting for the ANZSOC Division of 'Unlawful Entry With Intent/Burglary, Break and Enter'. If that ANZSOC Division is primarily related to planned criminal behaviour then that makes some sense, after all, if you're planning a crime you'd want to avoid cameras wouldn't you?\n",
    "\n",
    "There remain  a number of factors that could change our interpretation of the data and are unaddressed in this exercise.\n",
    "\n",
    "- We don't have the actual dates cameras were installed but it looks like about half or more were installed prior to the earliest date we have on the victimisation data that Police make available (at least with meshblocks).\n",
    "- The victimisation by time and place data does not include victimisations that occur in dwellings (such as the many apartments in central wellington)\n",
    "- There are likely some trialling COVID effects at the start of 2022. We really need a much longer timeframe over which to be examining this data.\n",
    "- How does Wellington compare to other main centres in NZ?"
   ]
  },
